import styled from "styled-components";

import { ICoupon } from "@interfaces";
import { CouponItem } from "./Item";

interface IProps {
    data: ICoupon;
}

export const CouponList = (props: IProps) => {
    const { data } = props;

    return (
        <StyledContainer>
            <CouponItem />
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 88%;
    margin: 0 auto;
    padding: 25px 0;
`;
